INSERT INTO `Event` VALUES ('cm7c9r8bd000014eync7fnnku','Community Tournament','MCCT Mobile Legends Magic Chess',NULL,'[\"A. Mengerti dan menerima Official Rules<br/>\\n&nbsp;&nbsp;&nbsp;&nbsp;1. Dengan berpartisipasi atau mendaftar dalam Turnamen, pemain mengakui bahwa mereka telah membaca, memahami, dan setuju untuk mematuhi Peraturan Resmi ini.<br/>\\n&nbsp;&nbsp;&nbsp;&nbsp;2. Partisipasi dalam Turnamen dibatasi untuk individu yang berusia minimal 16 tahun.<br/>\\n&nbsp;&nbsp;&nbsp;&nbsp;3. Modifikasi pada Peraturan Resmi<br/>\\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;- Mengingat sifat esports profesional yang terus berkembang, Peraturan Resmi ini dapat berubah atau dimodifikasi.<br/>\\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;- Penyelenggara berhak untuk memodifikasi, mengubah, atau menambah peraturan ini atas kebijakan Moonton.<br/>\\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;- Setiap perubahan akan diumumkan melalui saluran komunikasi resmi Turnamen di Discord, dan dengan terus berpartisipasi berarti Anda menerima perubahan tersebut.\",\"B. Persyaratan Peserta<br/>\\n&nbsp;&nbsp;&nbsp;&nbsp;1. Identitas Diri<br/>\\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;- Semua peserta setuju untuk memberikan ID pengguna, nomor Server, nomor telepon, email, dan tangkapan layar peringkat mereka pada saat pendaftaran; Mereka yang maju ke 16 besar harus mengirimkan foto yang sesuai seperti yang dipersyaratkan oleh penyelenggara.<br/>\\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;- Pemberian informasi ini bersifat sukarela, tetapi penolakan dapat mengakibatkan diskualifikasi. <br/>\\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;- Peserta setuju bahwa data di atas dapat digunakan untuk verifikasi kelayakan, partisipasi turnamen, dan promosi media.<br/>\\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;- Penyelenggara berkomitmen untuk melindungi data pribadi peserta sesuai dengan undang-undang perlindungan data yang berlaku, seperti General Data Protection Regulation (GDPR) atau undang-undang terkait lainnya.\",\"C. Pendaftaran<br/>\\n&nbsp;&nbsp;&nbsp;&nbsp;1. Pendaftaran gratis tidak dipungut biaya apa pun.<br/>\\n&nbsp;&nbsp;&nbsp;&nbsp;2. Pendaftaran dilakukan melalui Web https://mcggesports.id<br/>\\n&nbsp;&nbsp;&nbsp;&nbsp;3. Slot tournament : pendaftaran turnamen akan terus di buka sesuai dengan jadwal registrasi yang sudah ada dengan metode siapa yang mendaftar duluan akan diterima asalkan menginputkan semua kebutuhan yang dibutuhkan.<br/>\\n&nbsp;&nbsp;&nbsp;&nbsp;4. Tidak diperkenankan double slot / peserta yang sudah terdaftar tidak boleh mendaftarkan diri lagi.<br/>\\n&nbsp;&nbsp;&nbsp;&nbsp;5. Peserta harus menggunakan nama asli sesuai dengan yang tertera di identitas diri (KTP, SIM, dsb).\",\"Untuk Rules lengkap klik <a style=\\\"color: blue;\\\" href=\\\"https://docs.google.com/document/d/1p6fzOoAaeNrT5tedd-j_0rBYTvYiDK8aY3vreGBD1J4/edit?usp=drivesdk\\\">disini</a>\"]','\"\"','\"\"','https://www.youtube.com/embed/qKHLuCim_Bk','[\"07 Mar 2025\"]','2025-02-26 17:00:00.000','2025-05-04 17:00:00.000',512,'2025-02-19 18:51:07.609','2025-02-27 05:05:09.190',NULL),('cm7ca7ihz0000nl49v0o7bhyp','CHALLENGER','CHALLENGER Mobile Legend Chess',NULL,'[\"A. Participant Requirements<br/>\\n&nbsp;&nbsp;&nbsp;&nbsp;1. Participation<br/>\\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;- Players are registered as tournament participants when the player has registered themselves following all registration rules.<br/>\\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;- Losing Participants can join another phase of the tournament<br/>\\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;- Players are registered as tournament participants, required to bring their own devices<br/>\\n&nbsp;&nbsp;&nbsp;&nbsp;2. Personal Identity<br/>\\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;- All participants agree to provide their user ID, Server number, phone number, email, upon registration<br/>\\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;- Providing this information is voluntary, but refusal may result in disqualification.<br/>\\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;- Participants agree that the above data may be used for eligibility verification, tournament participation, and media promotion.<br/>\\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;- The Organizer is committed to protecting participantsâ€™ personal data in compliance with applicable data protection laws, such as the General Data Protection Regulation (GDPR) or other relevant laws.\",\"B. Venue<br/>\\n&nbsp;&nbsp;&nbsp;&nbsp;The tournament will be held onsite at the MCGG Booth in the MPL Arena, located in XO Hall - Jl. Tanjung Duren Barat III No.1, RT.9/RW.5, Tj. Duren Utara, Kec. Grogol petamburan, Kota Jakarta Barat, Daerah Khusus Ibukota Jakarta 11470\",\"C. Registration<br/>\\n&nbsp;&nbsp;&nbsp;&nbsp;1. Registration is free of charge.<br/>\\n&nbsp;&nbsp;&nbsp;&nbsp;2. Registration can be done via website and come visit to our offline booth at MPL ID Arena<br/>\\n&nbsp;&nbsp;&nbsp;&nbsp;3. Tournament registration will remain open as per the announced registration schedule. Slots will be allocated on a first-come, first-served basis, provided all registration requirements are met.<br/>\\n&nbsp;&nbsp;&nbsp;&nbsp;4. Double slots are not allowed / participants who have registered may not register again in the same day and phase during the tournament<br/>\\n&nbsp;&nbsp;&nbsp;&nbsp;5. Participants must use their real name as stated on their identity (Identity Card(KTP), Driver License(SIM), etc.).\"]','\"\"','\"\"','https://www.youtube.com/embed/qKHLuCim_Bk','[\"07 Mar 2025\",\"08 Mar 2025\",\"09 Mar 2025\"]','2025-03-02 17:00:00.000','2025-05-04 17:00:00.000',1000,'2025-02-19 19:03:47.303','2025-02-21 00:55:33.806','2025-02-21 00:55:33.762');
/*!40000 ALTER TABLE `Event` ENABLE KEYS */;
